import React from 'react'

const ProfileTabs = ({ item, onClick }) => {

  function handleClick() {
    onClick(item)
  }
  return(
    <div>
      <span className="edit right"> <Link to="/editprofile"> Edit Profile </Link> <i className="material-icons edit-icon">edit</i> </span>
      <li className="list tab" onClick={handleClick} >
        {item}
      </li>
    </div>
  )
}

export default ProfileTabs
